import React from 'react';
import { NavLink } from 'react-router-dom';
import './NavBar.css';

const NavBar = () => {
  return (
    <div className='NavBar'>
      <div className='logo'>
        <h1>Oussama</h1>
      </div>
      <div className='menu'>
        <ul>
          <li>
            <NavLink exact to="/" activeClassName="active-link">
              Home
            </NavLink>
          </li>
          <li>
            <NavLink to="/newsletters" activeClassName="active-link">
              Newsletters
            </NavLink>
          </li>
          <li>
            <NavLink to="/about" activeClassName="active-link">
              About us
            </NavLink>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default NavBar;
